import './App.css';
import ColorGradient from "./components/ColorGradient"

function App() {
  var canvas = document.getElementById("myCanvas");
  var ctx = canvas.getContext("2d");
  ctx.beginPath();
  ctx.arc(95,50,40,0,2*Math.PI);
  ctx.stroke();

  return (
    <div className="App">
      <ColorGradient />
    </div>
  );
}

export default App;
